  return (
    <div className="frame-2805">
      <Eyeoutline1 eyeProps={eyeoutline1Props.eyeProps} />
      <div className="address6 valign-text-middle inter-medium-monsoon-16px">{address}</div>
    </div>
  );
}

export default Frame2805;
